If you are generating the options for the dropdown list from an SQL query, you can make the dropdown list not have an option initially selected by adding an additional option element with the `selected` attribute before the options generated from the query.
Here is an example of how you could do it in PHP:
```php
<select id="exampleSelect">
  <option value="" selected disabled hidden>Select an option</option>
  <?php
    $conn = mysqli_connect("hostname", "username", "password", "database");
    $result = mysqli_query($conn, "SELECT id, name FROM table_name");
    while ($row = mysqli_fetch_array($result)) {
        echo '<option value="' . $row['id'] . '">' . $row['name'] . '</option>';
    }
  ?>
</select>
```
In this example, the first option element has the `selected` attribute, `disabled` attribute and also `hidden` attribute set, this way the first option will be selected by default and it won't be possible to select it, it also has a blank value for the `value` attribute.

If you're using AJAX, you can make the dropdown list not have an option initially selected by adding an additional option element with the `selected` attribute before the options generated from the query, Here is an example:
```javascript
success: function(data) {
  $("#exampleSelect").append('<option value="" selected disabled hidden>Select an option</option>');
  // Loop through the query results and create an option for each row
  $.each(data, function(i, item) {
    $("#exampleSelect").append('<option value="' + item.id + '">' + item.name + '</option>');
  });
}
