You can add a font weight of 400px to the `CustomDiv` component using the `font-weight` property in the CSS. Here is an example of how you can do this:
```
import styled from 'styled-components';

const fontStyles = {
  typography: {
    primary: {
      display: 'mnsLondonRegular',
      semiBold: 'mnsLondonBold'
    }
  }
}

const CustomDiv = styled.div`
  font-family: ${fontStyles.typography.primary.display || 'sans-serif'};
  font-weight: 400;
`;

function MyComponent() {
  return <CustomDiv>This text has a custom font.</CustomDiv>;
}
```
In this example, the `font-weight` property is set to `400` which will set the font weight to normal. The font weight value is in a scale of 100-900, where 100 is the thinnest and 900 is the thickest. So 400 is the normal font-weight.

You can also use keywords instead of numeric values for font-weight property.
```
const CustomDiv = styled.div`
  font-family: ${fontStyles.typography.primary.display || 'sans-serif'};
  font-weight: normal;
`;
```
This will have the same effect as setting `font-weight: 400`, you can use `lighter`, `normal`, `bold`, `bolder` as keywords instead of numeric values.

Please note that not all fonts have all the font-weight variations, it's best to check the font documentation to see what font-weight variations are available.

