```go
func (s *GoogleDomainsSolver) Solve(ch *challenge.DNS01, domainName string) error {
    // Create the HTTP client.
    client := &http.Client{}

    // Construct the API URL.
    url := fmt.Sprintf("https://domains.google.com/acme/challenge/%s/%s", s.email, domainName)

    // Get the DNS record details.
    recordName, recordValue, err := ch.DNS01Record(domainName)
    if err != nil {
        return err
    }

    // Construct the request body.
    requestBody := url.Values{}
    requestBody.Set("type", "TXT")
    requestBody.Set("name", recordName)
    requestBody.Set("rrdatas", fmt.Sprintf(`"%s"`, recordValue))

    // Construct the HTTP request.
    request, err := http.NewRequest(http.MethodPost, url, strings.NewReader(requestBody.Encode()))
    if err != nil {
        return err
    }
    request.Header.Set("Content-Type", "application/x-www-form-urlencoded")
    request.Header.Set("Authorization", fmt.Sprintf("Bearer %s", s.apiKey))

    // Send the HTTP request.
    response, err := client.Do(request)
    if err != nil {
        return err
    }
    defer response.Body.Close()

    // Check the response status code.
    if response.StatusCode != http.StatusOK {
        return fmt.Errorf("failed to add DNS record for domain %s: %s", domainName, response.Status)
    }

    // Wait for the DNS record to propagate.
    log.Printf("Waiting for DNS record to propagate for domain %s...", domainName)
    time.Sleep(time.Second * 15)

    // Return nil to indicate success.
    return nil
}
```
