def process_order(order):
    order_id = order["order_id"]
    requested = order["requested"]

    # Prepare shipments for products
    total_weight = 0
    current_shipment = {"order_id": order_id, "shipped": []}
    for product in requested:
        if product["product_id"] not in product_catalog:
            print(f"Error: Product ID {product['product_id']} not found in catalog")
            return
        stock = product_catalog[product["product_id"]]["quantity"]
        for i in range(product["quantity"]):
            if stock <= 0:
                print(f"Error: Not enough stock of product {product_catalog[product['product_id']]['name']}")
                break
            stock -= 1
            total_weight += product_catalog[product["product_id"]]["weight"]
            current_shipment["shipped"].append({"product_id": product["product_id"], "quantity": 1})
            if total_weight > MAX_SHIPMENT_WEIGHT:
                ship_package(current_shipment)
                total_weight = 0
                current_shipment = {"order_id": order_id, "shipped": []}
