        Row headerRow = sheet.getRow(0);
        ColumnMapping columnMapping = new ColumnMapping();

        for (Cell headerCell : headerRow) {
            String columnName = headerCell.getStringCellValue().trim();
            int columnIndex = headerCell.getColumnIndex();
            columnMapping.addColumn(columnName, columnIndex);
        }

        // Parse the rows and create domain models with actions
        for (int rowIndex = 1; rowIndex <= sheet.getLastRowNum(); rowIndex++) {
            Row row = sheet.getRow(rowIndex);

            String objectType = getStringCellValue(row, columnMapping.getColumnIndex("object_type"));

            if (objectType == null) {
                continue; // Skip rows with an empty object type
            }

            switch (objectType.toLowerCase()) {
                case "campaign":
                    ModelActionWrapper<Campaign> campaignWrapper = parseCampaignWrapper(row, columnMapping);
                    campaignWrappers.add(campaignWrapper);
                    break;
                case "adgroup":
                    ModelActionWrapper<AdGroup> adGroupWrapper = parseAdGroupWrapper(row, columnMapping);
                    adGroupWrappers.add(adGroupWrapper);
                    break;
                // Add more cases for other domain models
                default:
