To create a decoupled Supabase connection with rigorous error handling in Next.js, you can follow these steps:

1. Install the Supabase client library in your project:
```bash
npm install @supabase/supabase-js
```
2. Create a new file called `supabaseClient.ts` in your project's `utils` directory:
```typescript
import { createClient } from "@supabase/supabase-js";

// Your Supabase URL and Anon API Key will be available in your Supabase dashboard
const SUPABASE_URL = "https://your-supabase-url.supabase.co";
const SUPABASE_ANON_KEY = "your-supabase-anon-key";

// Create a new Supabase client instance
const supabaseClient = createClient(SUPABASE_URL, SUPABASE_ANON_KEY);

export default supabaseClient;
```
3. In your Next.js pages or components that need to interact with Supabase, import the `supabaseClient` instance you just created and use it to perform your desired actions:
```typescript
import { useState, useEffect } from "react";
import supabaseClient from "../utils/supabaseClient";

function MyComponent() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // Wrap Supabase API calls in a try-catch block to handle errors
    async function fetchData() {
      try {
        const { data: response, error } = await supabaseClient.from("my-table").select("*");

        if (error) {
          throw error;
        }

        setData(response);
      } catch (error) {
        console.error("An error occurred while fetching data from Supabase:", error);
      }
    }

    fetchData();
  }, []);

  return <div>{data ? JSON.stringify(data) : "Loading..."}</div>;
}
```

This code sets up a decoupled connection to Supabase by creating a separate `supabaseClient` instance that can be reused across different parts of your application. It also uses rigorous error handling by wrapping all Supabase API calls in a try-catch block and logging any errors that occur to the console.

